            window.setTimeout(() => {
              store.dispatch(
                keplerGl.addDataToMap({
                  datasets: loadedData.datasets,
                  config: loadedData.config,
                  options: {
                    centerMap: false,
                  },
                })
              );
            }, 500);
          }(KeplerGl, store))
        </script> </body></html>
